script: |
  super -f text -I q911.spq | sort > q911.out

inputs:
  - name: q911.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 4 BETWEEN + + 73 AND + 24 / - col0 + + + col1 + col1 + - CAST ( NULL AS REAL ) + + col0;
  - name: tab0

outputs:
  - name: q911.out
    data: |
      15	81	47
      87	21	10
      97	1	99
